import React, { useState } from "react";
import Login from "./pages/Login";

function App() {
  const [userEmail, setUserEmail] = useState(null);

  return (
    <div>
      {userEmail ? (
        <h1>Welcome, {userEmail}! (Next: Profile Page coming soon)</h1>
      ) : (
        <Login onLoginClick={setUserEmail} />
      )}
    </div>
  );
}

export default App;
